webpackJsonp([98482689835682],{427:function(t,o){t.exports={data:{markdownRemark:{html:"<p>There's way too many podcasts.  There's too many conferences, too many businesses, too many blogs.  Everyone wants to start their own thing.</p>\n<p>I do it too.  You're reading my blog right now.  Making things on your own is awesome, and it's never been easier.  </p>\n<p>So does that mean you shouldn't start the podcast (or blog, or business) you've been dreaming about?</p>\n<p>Of course not.  It just means that if you want people to listen to it, you have be better than most podcasts.  That could mean higher production value, better preparation, a topic no one is talking about, etc.</p>\n<p>We may not need \"just\" another podcast, but regardless of how saturated a market may be, there's always value in making something great.</p>",frontmatter:{path:"/too-many-podcasts",title:"Too many podcasts",date:"2017-07-29T00:00:00.000Z",tag:"Thoughts"}}},pathContext:{}}}});
